import React from "react";
import "./Key.css";

const Key = () => {
    return (
        <div className="Key">
            <hr className="TopBorder"/>
            <div className="Items">
                <h4>Key</h4>
                <div className="Allergens">
                    <p>Favorite</p>
                    <p>Vegetarian</p>
                    <p>Gluten free</p>
                    <p>Nut free</p>
                </div>
            </div>
        </div>
    )
}

export default Key;
